import RegistrationForm from './components/RegistrationForm';
import { Routes, Route } from 'react-router-dom';
import Bill from './components/Bill';
import './sass/_defaul'

const App = () => {
  return (
    <Routes>
      <Route path='/' element={<RegistrationForm />} />
      <Route path='/form' element={<Bill />} />
    </Routes>
  );
};

export default App;
